import React from "react";
import Book from "./Book";

function BookList(props) {
  let listedBooks = props.myBookList.map(book => {
    return (
      <Book
        title={props.title}
        author={props.author}
        page_size={props.page_size}
      />
    );
  });
  return <div>{listedBooks}</div>;
}

export default BookList;
